import React from 'react'
import { Link } from 'react-router-dom';

export default class App extends React.Component {
  render() {
    return (
      <div className="App">
        <h4><Link to={'/'}>Curso</Link> /></h4>
        <nav>
          <Link to={'/'}></Link> />
          <Link to={'/'} />
          <Link to={'/'} />
          <Link to={'/'} />
        </nav>
      </div>
    );
  }
}
